import React from "react";
import memory from './memory.js';
import './memory.css'
import styled from "styled-components";




const memorySection = styled.div` 
    width: 100vw;
    height: 73px;
    top:40px;
`;

const memoryTitle = styled.h2`
    width: 400px;
    height: 19px;
    font-style: normal;
    font-weight: 700;
    fontSize: 16px;
    lineHeight: 23px;
    color: #000000;
`;
 
  const memoryRow = styled.div`
    display: flex;
    flex-direction: row;
    align-items:flex-start;
    padding: 0px;
    gap: 10px;   
    width: 298px;
    height: 60px;
    left: 0px;
    top:20px;
`;
 
 const memoryGigabytes = styled.a`
    display: flex;
    flex-direction: column;
    justify-content:center;
    width: 100px;
    height: 40px;
    padding: 10px 25px;
    gap: 10px;
    border: 1px solid #888888;
    border-radius: 4px;
    color: #000000;   
`;

const memoryFont = styled.span`
    width: 52px;
    height: 19px;
    font-style: normal;
    font-weight: 500;
    font-size: 16px;
    line-height: 19px;
    color: #000000;
`;


function Memory() {

return(
    <memorySection>
        <memoryTitle>Конфигурация памяти: 128gb</memoryTitle>
            <memoryRow key = {memory.toString}>
                {memory.map((gigabyte) => (
                    <memoryGigabytes href={gigabyte.link}><memoryFont>{gigabyte.number}</memoryFont></memoryGigabytes>
                ))}
            </memoryRow>
    </memorySection>
    );
}

export default Memory
